const balanceStats = [];

const BalanceStats = (state = balanceStats, action) => {
  switch (action.type) {
    case "GET_BALANCE":
      return {
        ...state,
        balance: [action.payLoad],
      };
    default:
      return state;
  }
};

export default BalanceStats;
